import React, { Component } from 'react';
import styles from './signin.module.css';
import FormField from '../widgets/FormFields/formFields';

class SignIn extends Component{
    state = {
        registerError:'',
        loading:false,
        formdata:{
            email:{
                element:'input',
                value:'',
                config:{
                    name:'email_input',
                    type:'email',
                    palceholder:'Enter Your Email'
                },
                validation:{
                    required: true,
                    email: true
                },
                valid: false,
                touched: false,
                validationMessage:''
            },
            password:{
                element:'input',
                value:'',
                config:{
                    name:'password_input',
                    type:'password',
                    palceholder:'Enter Your Password'
                },
                validation:{
                    required: true,
                    password: true
                },
                valid: false,
                touched: false,
                validationMessage:''
            }
        }
    }

    render(){
        return(
            <div className={styles.logContainer}>
                <form>
                    <FormField
                        id={'email'}
                        formdata={this.state.formdata.email}
                        change={(element) => this.updateForm(element)}
                    />
                </form>
            </div>
        )
    }
}
export default SignIn;
